import React from "react";
import { makeStyles } from "@material-ui/styles";
import {
  Box,
  Button,
  Typography,
  Card,
  CardContent,
  Fab,
  Container,
  TextField,
} from "@material-ui/core";
import DescriptionOutlinedIcon from "@material-ui/icons/DescriptionOutlined";

const useStyles = makeStyles((theme) => ({
  overlay: {
    position: "fixed",
    top: 0,
    left: 0,
    bottom: 0,
    minWidth: "100vw",
    backgroundColor: "rgba(10,40,100,0.9)",
  },
  pannel: {
    position: "fixed",
    left: "28vw",
    marginTop: "20vh",
    zIndex: 1000000000000000,
    width: "32vw",
    padding: theme.spacing(3),
    backgroundColor: " #fff",
    borderRadius: 5,
    display: "flex",
    alignItems: "center",
    flexDirection: "column",
    boxShadow: "0 0 15px rgba(10,40,100,0.1)",
  },
  icon: {
    padding: "10px",
  },
}));

const OverlayCompany = ({ closeModal }) => {
  const classes = useStyles();

  return (
    <React.Fragment>
      <Box className={classes.overlay}>
        <Container
          onClick={closeModal}
          className={classes.pannel}
          maxWidth="md"
        >
          <form className={classes.root} noValidate autoComplete="off">
            <TextField id="username1" label="First Name" />
            <TextField id="username2" label="Last Name" />
            <TextField id="email" label="Email" variant="filled" />
          </form>
          <Fab variant="extended" className={classes.candidater}>
            Soumettre <DescriptionOutlinedIcon />
          </Fab>
          <Fab variant="extended" className={classes.candidater}>
            Annuler <DescriptionOutlinedIcon />
          </Fab>
        </Container>
      </Box>
    </React.Fragment>
  );
};

export default OverlayCompany;
